import "./Categoria.css"
import Video from "../Video/Video"

const Categoria = (props) => {
    //Destructuracion
    const { colorPrimario, titulocategoria } = props.datos
    const { videos } = props
    const obj = {
        backgroundColor: colorPrimario
    }
    console.log(videos.length > 0)

    const estiloTitulo = { borderColor: colorPrimario }

    return <>
        {
            videos.length > 0 &&
            <section className="categoria" style={obj}>
                <h3 style={estiloTitulo} >{titulocategoria}</h3>
                <div className="videos" style={obj}>
                    {
                        videos.map((video, index) => <Video datos={video} key={index} />)
                    }
                </div>
            </section>
        }
    </>
}

export default Categoria;
